LULA É LADRÃO, DESCONDENADO, CORRUPTO, EX-PRESIDIÁRIO, E O GRANDE CHEFE DA QUADRILHA DOS CRIMINOSOS QUE QUEBRARAM O BRASIL, OU SEJA, É O PIOR MONSTRO QUE A NATUREZA CRIOU!!!

 *_ALÉM DISSO, É A FAVOR:_* 

- DO ABORTO; 

- DAS DROGAS;

- DOS BANDIDOS E DOS TRAFICANTES; 

- DOS NARCOESTADOS;

- DA CAÇA AOS CRISTÃOS E DO FECHAMENTO DAS IGREJAS;

- DE ARMAMENTO SÓ PARA OS BANDIDOS SEUS AMIGUINHOS;

- DOS DITADORES DA AMÉRICA LATINA QUE SÃO SEUS ÍDOLOS E AMIGOS;

- DA MISÉRIA DO POVO;

- DA IGNORÂNCIA DO POVO;

- DO QUANTO PIOR, MELHOR;

- DA MENTIRA;

- DAS TREVAS;

- ENFIM, DA ESBÓRNIA GENERALIZADA!!!
